import carimage from "../../asset/img_car.png";
import "./style.css";
import { Button } from "@mui/material";
import imgservice from "../../asset/img_service.png";
import React from "react";
import { Box } from "@mui/system";
import { Link } from "react-router-dom";

const Benner = () => {
  return (
    <div class="MuiGrid-root MuiGrid-container MuiGrid-wrap-xs-nowrap css-1k9fwqc">
      <div class="MuiGrid-root MuiGrid-item MuiGrid-grid-md-7 MuiGrid-grid-lg-6 css-c60gp0">
        <div class="MuiBox-root css-5m5pwe">
          <h1 class="MuiTypography-root MuiTypography-h1 css-ccpwgd">
            <span class="css-v52121">Move faster</span> with intuitive React UI
            tools
          </h1>
          <p class="MuiTypography-root MuiTypography-body1 css-1ur90vz">
            MUI offers a comprehensive suite of UI tools to help you ship new
            features faster. Start with Material UI, our fully-loaded component
            library, or bring your own design system to our production-ready
            components.
          </p>
          <div class="MuiBox-root css-1i1hc4z">
            <a
              data-no-markdown-link="true"
              class="MuiButton-root MuiButton-contained MuiButton-containedPrimary MuiButton-sizeLarge MuiButton-containedSizeLarge MuiButton-disableElevation MuiButtonBase-root  css-14u57vb"
              tabindex="0"
              href="/material-ui/getting-started/overview/"
            >
              Get started
              <span class="MuiButton-endIcon MuiButton-iconSizeLarge css-1ab87kf">
                <svg
                  class="MuiSvgIcon-root MuiSvgIcon-fontSizeMedium css-vubbuv"
                  focusable="false"
                  aria-hidden="true"
                  viewBox="0 0 24 24"
                  data-testid="KeyboardArrowRightRoundedIcon"
                >
                  <path d="M9.29 15.88 13.17 12 9.29 8.12a.9959.9959 0 0 1 0-1.41c.39-.39 1.02-.39 1.41 0l4.59 4.59c.39.39.39 1.02 0 1.41L10.7 17.3c-.39.39-1.02.39-1.41 0-.38-.39-.39-1.03 0-1.42z"></path>
                </svg>
              </span>
              <span class="MuiTouchRipple-root css-w0pj6f"></span>
            </a>
            <div class="MuiBox-root css-4km4ms"></div>
            <button
              class="MuiButton-root MuiButton-code MuiButton-codePrimary MuiButton-sizeLarge MuiButton-codeSizeLarge MuiButton-disableElevation MuiButtonBase-root  css-1id44e"
              tabindex="0"
              type="button"
            >
              npm install @mui/material @emotion/react @emotion/styled
              <span class="MuiButton-endIcon MuiButton-iconSizeLarge css-1ab87kf">
                <svg
                  class="MuiSvgIcon-root MuiSvgIcon-fontSizeMedium css-vubbuv"
                  focusable="false"
                  aria-hidden="true"
                  viewBox="0 0 24 24"
                  data-testid="ContentCopyRoundedIcon"
                >
                  <path d="M15 20H5V7c0-.55-.45-1-1-1s-1 .45-1 1v13c0 1.1.9 2 2 2h10c.55 0 1-.45 1-1s-.45-1-1-1zm5-4V4c0-1.1-.9-2-2-2H9c-1.1 0-2 .9-2 2v12c0 1.1.9 2 2 2h9c1.1 0 2-.9 2-2zm-2 0H9V4h9v12z"></path>
                </svg>
              </span>
              <span class="MuiTouchRipple-root css-w0pj6f"></span>
            </button>
          </div>
        </div>
      </div>
      <div class="MuiGrid-root MuiGrid-item MuiGrid-grid-md-5 MuiGrid-grid-lg-6 css-trleb">
        <div
          class="MuiBox-root css-1ccnpob"
          id="hero-container-right-area"
          aria-hidden="true"
        ></div>
      </div>
    </div>
  );
};

export default Benner;

